###Creating data used in the StateScale Survey Tool.  Don't worry yourself with understanding this code. 
#Just look at the data structure as you walk through the tool and make sure your data matches it, or you modify accordingly

#Survey Data####
#DataFrame of sampling locations with supplemental information
#creating dataframe
surveyData<-data.frame("siteID"=c(1:750),
                       "Year"=as.numeric(c(NA)),
                       "Basin"=c("BasinNames"),
                       "SubBasin"=c("SubBasins"),
                       "EcoRegion"=c("Ecoregions"),
                       "IR2016"=c(2016),
                       "IR2018"=c(2018),
                       "evaluated"=c(1),
                       "Sampled"=c(0))

i <- sapply(surveyData, is.factor)
surveyData[i] <- lapply(surveyData[i], as.character)

surveyData$Year[1:50]=2009
surveyData$Year[51:80]=2010
surveyData$Year[81:124]=2011
surveyData$Year[125:200]=2012
surveyData$Year[201:300]=2013
surveyData$Year[301:350]=2014
surveyData$Year[351:400]=2015
surveyData$Year[401:500]=2016
surveyData$Year[501:675]=2017
surveyData$Year[676:750]=2018

basins<-c("South", "North", "East", "West", "Central")
for(i in 1:5){  
  surveyData$Basin[seq(from=i,to=nrow(surveyData), by=5)]=basins[i]
}

subbasins<-c("Mordor", "Mirkwood", "Isengard", "Moria", "Rohan",
          "Gondor", "Numenor", "Lorina", "Rivendell", "Shire")
for(i in 1:10){  
  surveyData$SubBasin[seq(from=i,to=nrow(surveyData), by=10)]=subbasins[i]
}

eco<-c("Piedmont", "Middle Atlantic Coastal Plain", "Blue Ridge Mountains", "Southeastern Plains", "Central Appalachians")
for(i in 1:5){  
  surveyData$EcoRegion[seq(from=i,to=nrow(surveyData), by=5)]=eco[i]
}

surveyData$IR2016[301:750]<-0
surveyData$IR2018[501:750]<-0
surveyData$IR2018[1:80]<-0
surveyData$Sampled[seq(from=1,to=nrow(surveyData), by=2.5)]=1

#Middle Earth Sampling Points####
#Obviously, the lat/longs in the middle earth shapefiles are not real, 
#they reference space on a regular x/y coordinate system

#ignore next four lines. Generating random sampling coordinates to populate middle earth

#without defined coordinate references systems, spatial analysis tools like clipping do not work
longitude<-sample(323000:(max(towns@coords[1:575,1])), 750, replace=F)
latitude<-sample(230000:(max(towns@coords[1:575,2])), 750, replace=F)

sampleloc<-cbind(longitude, latitude)

SampleData<-cbind(sampleloc, surveyData)
